import { Link } from "react-router-dom";

const PRODUCTS = [
  { id: "e1", title: "Event1" },
  { id: "e2", title: "Event2" },
  { id: "e3", title: "Event3" },
  { id: "e4", title: "Event4" },
  { id: "e5", title: "Event5" },
];

const EventsPage = () => {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};

export default EventsPage;
